import XCTest

@testable import LeetCode

final class LongestSubstringWithoutRepeatingCharactersTests: XCTestCase {

    // MARK: - Tests
    
    func test_A() {
        let s = "abcabcbb"
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
    func test_B() {
        let s = "bbbbb"
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(1, longest)
    }
    
    func test_C() {
        let s = "pwwkew"
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
    func test_D() {
        let s = " "
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(1, longest)
    }
    
    func test_E() {
        let s = "abcde"
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(5, longest)
    }
    
    func test_F() {
        let s = ""
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(0, longest)
    }
    
    func test_G() {
        let s = "dvdf"
        
        let longest = LongestSubstringWithoutRepeatingCharacters.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
